import './Sidebar.css';

export const Sidebar = ({drawerIsOpen, drawerHandler}) => {
    return (
        <div className={drawerIsOpen ? 'side-drawer open' : 'side-drawer'}>
            <button onClick={() => drawerHandler(false)}>Close</button>
            <DesktopNavigationTabs/>
        </div>
    )
}
